import React, { useState } from "react";
import { useNavigate } from "react-router-dom";

const AshaWorkerLogin = () => {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const navigate = useNavigate();

  // Define valid Asha Worker credentials
  const validAshaWorkers = [
    { email: "ashaworker123@gmail.com", password: "password1" },
    { email: "asha2@example.com", password: "password2" },
  ];

  const handleLogin = (e) => {
    e.preventDefault();

    // Check if the email and password match any valid Asha Worker
    const isValid = validAshaWorkers.some(
      (worker) => worker.email === email && worker.password === password
    );

    if (isValid) {
      // Redirect to the dashboard if credentials are valid
      navigate("/asha-dashboard");
    } else {
      // Show an error message if credentials are invalid
      alert("Invalid email or password. Please try again.");
    }
  };

  return (
    <div className="flex items-center justify-center min-h-screen bg-gray-100">
      <div className="bg-white p-8 rounded-lg shadow-md w-96">
        <h2 className="text-2xl font-bold mb-6 text-center">Asha Worker Login</h2>
        <form onSubmit={handleLogin}>
          <div className="mb-4">
            <label className="block text-sm font-medium mb-2">Email</label>
            <input
              type="email"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              className="w-full p-2 border rounded-lg"
              required
            />
          </div>
          <div className="mb-6">
            <label className="block text-sm font-medium mb-2">Password</label>
            <input
              type="password"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              className="w-full p-2 border rounded-lg"
              required
            />
          </div>
          <button
            type="submit"
            className="w-full bg-blue-500 text-white p-2 rounded-lg hover:bg-blue-600"
          >
            Login
          </button>
        </form>
      </div>
    </div>
  );
};

export default AshaWorkerLogin;
